import React from 'react';

function Login() {
  // Por enquanto, nosso componente só vai retornar um título simples.
  return <h1>Isso é a tela de Login.</h1>;
}

// Linhas de diagnóstico:
// Vamos imprimir no console do navegador para ver o que estamos exportando.
console.log("Exportando o componente Login:", Login);
console.log("Tipo do componente Login:", typeof Login);

export default Login;
